import React from "react";
// import logo from "../public/ninjalogo.png";
// import "./SignatureFooter.css";

function SignatureFooter(ninjalogo) {
  return (
    <div className="signature-footer-container">
      <img src={ninjalogo} alt="100ninjas Logo" className="signature-footer-logo" />
      <p className="signature-footer-text">Built by 100ninjas</p>
    </div>
  );
}

export default SignatureFooter;
